import React, { Component } from 'react';
import '../styles/about.scss';
import '../img'

export class About extends Component {
    render() {
        return (
            <div className="about-container">
                <div className="textarea">
                    <h2>About me</h2>
                    <p>I’m Gabrielle Kamph, a 32 year old digital creative and front-end developer based in Stockholm, Sweden. <br/><br/>
                    I’m currently studying the front-end developer program at <a href="https://medieinstitutet.se/utbildningar/front-end-developer/">Medieinstitutet</a> to get cutting-edge knowledge in the field, graduating fall 2022. <br/><br/>
                    I have extensive experience within digital marketing and a broad palette of skills alongside web development such as inbound marketing, copywriting, project management, marketing automation and graphic design. <br /><br/>
                    My career so far includes a wide range of roles, from generalist to specialist on both the agency and client side, which has given me great knowledge and humility to bring into future roles.<br/><br/>
                    I look forward to further expand my tech stack which currently contains HTML, CSS/SASS, JavaScript, React, Node.js, mongoDB and of course Git and GitHub.
                    <br/><br/>Don't hesitate to get in touch!</p>
                </div>
                <div className="img-area">

                <img src="../img/gabs.jpg" alt="Picture of Gabrielle Kamph"></img>

                </div>
            </div>
        )
    }
}

export default About
